import React from "react"

import { render } from "react-dom"

import { BrowserRouter } from "react-router-dom"

import Base from "./components/Base"

function Home() {
  return (
    render(

      <BrowserRouter>
    
        <Base />
    
      </BrowserRouter>,
    
      document.querySelector("root"),
    
    )
  )
}
    

export default Home;
